import React from "react";
import {Container,Row,Col,Image} from 'react-bootstrap';
import './header.scss';
function Header (){
return(
    <div className="header-div">
        <Container>
            <Row>
                <Col>
                    <Image className="logo" src={'/Images/logo.png'} rounded={true} />
                </Col>
            </Row>
        </Container>
    </div>
);
}

export default Header;
